    import React, { useState, useEffect } from 'react';
    import { Link } from 'react-router-dom';
    import { getActivities } from '../services/activityService';

    const ActivityPage = () => {
    const [activities, setActivities] = useState([]);

    useEffect(() => {
        loadActivities();
    }, []);

    const loadActivities = async () => {
        try {
        const loadedActivities = await getActivities();
        setActivities(loadedActivities);
        } catch (error) {
        console.error("Error al cargar las actividades:", error);
        }
    };

    return (
        <div className="container mx-auto px-4 py-8">
        <div className="flex justify-between items-center mb-6">
            <h1 className="text-3xl font-bold">Lista de Deseos de Lindsay y Jeff</h1>
            <Link to="/new-wish" className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600">
            Agregar Nuevo Deseo
            </Link>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
            {activities.map((activity) => (
                <div key={activity.id} className="flex items-center mb-4 bg-white p-4 rounded-lg shadow">
                <img src={activity.image} alt={activity.title} className="w-16 h-16 object-cover rounded-lg mr-4" />
                <div>
                    <h2 className="text-xl font-semibold">{activity.title}</h2>
                    <p className="text-gray-600">Agregado por {activity.addedBy} hace {activity.daysAgo} días</p>
                </div>
                </div>
            ))}
            </div>

            <div className="bg-gray-100 p-6 rounded-lg">
            <h2 className="text-2xl font-bold mb-4">Agregar un Deseo</h2>
            <div className="space-y-4">
                <Link to="/new-wish" className="flex items-center w-full bg-white p-3 rounded-lg hover:bg-gray-50">
                <svg className="w-6 h-6 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13.828 10.172a4 4 0 00-5.656 0l-4 4a4 4 0 105.656 5.656l1.102-1.101m-.758-4.899a4 4 0 005.656 0l4-4a4 4 0 00-5.656-5.656l-1.1 1.1" />
                </svg>
                <span>Pegar un enlace</span>
                <p className="ml-auto text-gray-500">Agrega un enlace a tus productos favoritos o cualquier otra cosa que desees</p>
                </Link>
                <Link to="/new-wish" className="flex items-center w-full bg-white p-3 rounded-lg hover:bg-gray-50">
                <svg className="w-6 h-6 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 9a2 2 0 012-2h.93a2 2 0 001.664-.89l.812-1.22A2 2 0 0110.07 4h3.86a2 2 0 011.664.89l.812 1.22A2 2 0 0018.07 7H19a2 2 0 012 2v9a2 2 0 01-2 2H5a2 2 0 01-2-2V9z" />
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 13a3 3 0 11-6 0 3 3 0 016 0z" />
                </svg>
                <span>Tomar una foto</span>
                <p className="ml-auto text-gray-500">Agrega una foto de algo que quieras</p>
                </Link>
                <Link to="/new-wish" className="flex items-center w-full bg-white p-3 rounded-lg hover:bg-gray-50">
                <svg className="w-6 h-6 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M11 5H6a2 2 0 00-2 2v11a2 2 0 002 2h11a2 2 0 002-2v-5m-1.414-9.414a2 2 0 112.828 2.828L11.828 15H9v-2.828l8.586-8.586z" />
                </svg>
                <span>Escribir una nota</span>
                <p className="ml-auto text-gray-500">Describe lo que te gustaría</p>
                </Link>
            </div>
            </div>
        </div>
        </div>
    );
    };

    export default ActivityPage;
